import React, { useState, useEffect } from 'react';
import { getMentorEvaluation } from '../../services/studentApi';
import { toast } from 'react-hot-toast';

const MentorEvaluation = () => {
  const [evaluations, setEvaluations] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchEvaluations = async () => {
      try {
        const response = await getMentorEvaluation();
        setEvaluations(response.data);
      } catch (error) {
        console.error('Error fetching evaluations:', error);
        toast.error('Failed to load mentor evaluations');
      } finally {
        setLoading(false);
      }
    };

    fetchEvaluations();
  }, []);

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-emerald-500"></div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="bg-white shadow-sm rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h1 className="text-2xl font-semibold text-gray-900 mb-6">
            Mentor Evaluations
          </h1>

          {evaluations.length === 0 ? (
            <div className="text-center py-12">
              <p className="text-gray-500">No evaluations available yet.</p>
            </div>
          ) : (
            <div className="space-y-6">
              {evaluations.map((evaluation, index) => (
                <div
                  key={index}
                  className="bg-white border border-gray-200 rounded-lg p-6"
                >
                  <div className="flex items-center justify-between mb-4">
                    <div>
                      <h3 className="text-lg font-medium text-gray-900">
                        {evaluation.title}
                      </h3>
                      <p className="text-sm text-gray-500">
                        Evaluated on: {new Date(evaluation.date).toLocaleDateString()}
                      </p>
                    </div>
                    <span className={`px-3 py-1 rounded-full text-sm font-medium ${
                      evaluation.status === 'completed' 
                        ? 'bg-green-100 text-green-800'
                        : 'bg-yellow-100 text-yellow-800'
                    }`}>
                      {evaluation.status}
                    </span>
                  </div>

                  {/* Evaluation Categories */}
                  <div className="space-y-4">
                    {evaluation.categories?.map((category, idx) => (
                      <div key={idx} className="border-t border-gray-200 pt-4">
                        <h4 className="text-sm font-medium text-gray-900 mb-2">
                          {category.name}
                        </h4>
                        <div className="flex items-center">
                          <div className="flex-1">
                            <div className="h-2 bg-gray-200 rounded">
                              <div
                                className="h-2 bg-emerald-500 rounded"
                                style={{ width: `${category.score}%` }}
                              ></div>
                            </div>
                          </div>
                          <span className="ml-4 text-sm font-medium text-gray-700">
                            {category.score}/100
                          </span>
                        </div>
                      </div>
                    ))}
                  </div>

                  {/* Mentor Comments */}
                  {evaluation.comments && (
                    <div className="mt-6 border-t border-gray-200 pt-4">
                      <h4 className="text-sm font-medium text-gray-900 mb-2">
                        Mentor Comments
                      </h4>
                      <p className="text-gray-700 whitespace-pre-line">
                        {evaluation.comments}
                      </p>
                    </div>
                  )}

                  {/* Recommendations */}
                  {evaluation.recommendations && (
                    <div className="mt-4 border-t border-gray-200 pt-4">
                      <h4 className="text-sm font-medium text-gray-900 mb-2">
                        Recommendations
                      </h4>
                      <ul className="list-disc list-inside text-gray-700 space-y-1">
                        {evaluation.recommendations.map((rec, idx) => (
                          <li key={idx}>{rec}</li>
                        ))}
                      </ul>
                    </div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default MentorEvaluation;
